import React from 'react';

function Login() {
    return (
        <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
            <div className='bg-white p-3 rounded w-25'>
                <form action="">
                    <div className='mb-3'>
                        <label htmlFor="email">Correo</label>
                        <input type="email" id="email" placeholder='Ingrese su correo' className='form-control rounded-0'/>
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="password">Contraseña</label>
                        <input type="password" id="password" placeholder='Ingrese su contraseña' className='form-control rounded-0'/>
                    </div>
                    <button className='btn btn-success w-100 rounded-0' type="submit">Ingresar</button>
                    <p>Aceptas nuestras politicas y terminos de seguridad</p>
                    <button className='btn btn-default border w-100' type="button">Crear Cuenta</button>
                </form>
            </div>
        </div>
    );
}

export default Login;
